// @ts-nocheck
'use strict';

var test = require('tape');

// Renomeei para nomes mais descritivos para evitar conflito com o `T` da função de teste
var E = require('../');           // Esperado: Error
var R = require('../range');      // Esperado: RangeError
var Ref = require('../ref');      // Esperado: ReferenceError
var S = require('../syntax');     // Esperado: SyntaxError
var Type = require('../type');    // Esperado: TypeError

test('errors', function (t) {
	t.equal(E, Error, 'E deve ser Error');
	t.equal(R, RangeError, 'R deve ser RangeError');
	t.equal(Ref, ReferenceError, 'Ref deve ser ReferenceError');
	t.equal(S, SyntaxError, 'S deve ser SyntaxError');
	t.equal(Type, TypeError, 'Type deve ser TypeError');

	t.end();
});
